import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './ResourcesPage.css'; // External CSS for styling

const ResourcesPage = () => {
  const [resources, setResources] = useState([]);
  const [message, setMessage] = useState('');
  const [loading, setLoading] = useState(true);
  const [file, setFile] = useState(null);
  const [title, setTitle] = useState('');
  const [uploadMessage, setUploadMessage] = useState('');

  useEffect(() => {
    const token = localStorage.getItem('token');

    if (token) {
      axios
        .get('http://localhost:8000/resources/all', {
          headers: { Authorization: `Bearer ${token}` },
        })
        .then((response) => {
          setResources(response.data.resources);
          setLoading(false);
        })
        .catch((err) => {
          console.error(err);
          setMessage('Error loading resources.');
          setLoading(false);
        });
    } else {
      setMessage('Access denied. Please log in.');
      setLoading(false);
    }
  }, []);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  const handleTitleChange = (e) => {
    setTitle(e.target.value);
  };

  const handleFileUpload = (e) => {
    e.preventDefault();
    const token = localStorage.getItem('token');

    if (!file || !title) {
      setUploadMessage('Please select a file and enter a title.');
      return;
    }

    const formData = new FormData();
    formData.append('file', file);
    formData.append('title', title);

    if (token) {
      axios
        .post('http://localhost:8000/resources/upload', formData, {
          headers: {
            Authorization: `Bearer ${token}`,
            'Content-Type': 'multipart/form-data',
          },
        })
        .then((response) => {
          setUploadMessage('File uploaded successfully!');
          setResources((prev) => [...prev, response.data.resource]); // Add new resource
          setFile(null);
          setTitle('');
        })
        .catch((err) => {
          console.error(err);
          setUploadMessage('Failed to upload file.');
        });
    } else {
      setUploadMessage('Access denied. Please log in.');
    }
  };

  return (
    <div className="resources-page">
      <header className="header">
        <h1>Resources</h1>
        <p className="subtitle">Manage your files and resources in one place.</p>
      </header>

      <main>
        <section className="upload-section">
          <h2>Upload a Resource</h2>
          <form onSubmit={handleFileUpload} className="upload-form">
            <input
              type="text"
              placeholder="Resource Title"
              value={title}
              onChange={handleTitleChange}
              className="input-field"
            />
            <input
              type="file"
              onChange={handleFileChange}
              className="input-field file-input"
            />
            <button type="submit" className="upload-btn">Upload</button>
          </form>
          {uploadMessage && <p className="upload-message">{uploadMessage}</p>}
        </section>

        <section className="resources-section">
          <h2>Available Resources</h2>
          {loading && <p className="loading">Loading resources...</p>}
          {message && <p className="error">{message}</p>}

          <div className="resource-grid">
            {resources.length > 0 ? (
              resources.map((resource) => (
                <div key={resource.resource_id} className="resource-card">
                  <h3>{resource.title}</h3>
                  <p><strong>Type:</strong> {resource.type}</p>
                  <p><strong>Uploaded:</strong> {new Date(resource.upload_date).toLocaleDateString()}</p>
                  <button className="view-btn">View Resource</button>
                </div>
              ))
            ) : (
              <p className="empty">No resources available.</p>
            )}
          </div>
        </section>
      </main>
    </div>
  );
};

export default ResourcesPage;
